INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Darlyne Sheppard Alcatraz Photo Collection','Serving the Christmas Meal, c 1951','Cook serving Christmas dinner with menu posted above.','An inmate worker distributes trays near the steam table. Bars separate the kitchen from the mess hall.  The day’s menu, the Christmas meal, appears on a sign over his head. The menu includes consomme, stuffed celery, green olives and mixed sweet pickles,','https://www.nps.gov/common/uploads/structured_data/A64B4FF8-1DD8-B71B-0B63B232325C8081.jpg',47);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','A homeland changed','Group of people around a Russian cross in tall grass','In September 2009, Nick Lekanoff, Sr., former Makushin resident, traveled with his daughter and other descendants of Makushin on the Tiglax to visit the village site, which had been left behind in the evacuation of 1942 and never permanently resettled.','https://www.nps.gov/common/uploads/structured_data/3C7BC1AE-1DD8-B71B-0BF60FDE7A21822B.jpg',48);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Photograph courtesy National Archives','William C. House and the Aerological Detail on Kiska','Twelve men and a dog pose for a photo','After his aerological crew was captured by the Japanese in June, 1942, Senior Petty Officer William House survived 50 days in the hills of Kiska.  He ate grass, shellfish, and worms. Weighing 80lbs he surrendered and was respected for his perseverance.','https://www.nps.gov/common/uploads/structured_data/3C7BC37B-1DD8-B71B-0BA4AF7F3700FE86.jpg',49);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Photograph courtesy National Archives','Evacuation and internment','People crowd at the railing of a ship','Pribilof villagers, here lining the railing of the USAT Delarof on the day of their departure (June 15, 1942), were evacuated with only a few hours notice and no idea of their ultimate destination.','https://www.nps.gov/common/uploads/structured_data/3C7BC517-1DD8-B71B-0BD7C869F63B3276.jpg',50);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Photo courtesy of National Archives','Challenging weather conditions','Four men gather around a invalid man','Soldiers rub the frostbitten feet of a disabled soldier. Over 2000 weather-related casualties—the majority Attu feet—were recorded for U.S. troops. This number represents the largest classification of casualties suffered by American forces on the island.','https://www.nps.gov/common/uploads/structured_data/3C7BC68B-1DD8-B71B-0BED69DAACF6A5AC.jpg',51);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Photo courtesy National Archives','The battle for Attu Island','Six men with guns carry a person on a stretcher in a valley.','U.S. wounded are gathered from the battlefield on Attu Island.  The battle on Attu, lasting nearly 20 days, was the second most deadly in the Pacific Theater.','https://www.nps.gov/common/uploads/structured_data/3C7BC7CF-1DD8-B71B-0B73637962E06C74.jpg',52);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Photo courtesy National Archives','Cultural collision','A uniformed man holds up a broken Russian cross','The Aleutian campaign brought together Russian, Native Alaskan, Japanese, and Euroamerican cultures. During the war 7 historic churches were damaged or destroyed. Villages were unrecognizable or burned to the ground and personal belonging lost or stolen.','https://www.nps.gov/common/uploads/structured_data/3C7BC97B-1DD8-B71B-0B9A70C0C0988F0E.jpg',53);
