INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Historic Site of Camp Sumter Civil War Military Prison at Andersonville','A cannon sits out in front of a replica of part of the wooden stockade walls once at Andersonville','Camp Sumter Military Prison, known as Andersonville, was the deadliest ground of the Civil War. Nearly 13,000 American soldiers died here.','https://www.nps.gov/common/uploads/structured_data/3C87F1CB-1DD8-B71B-0B8B6223F6173DF9.jpg',85);
