INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Camas Blooms Near the Nez Perce Camp at the Big Hole','Blue camas flowers dot a green field with tepee poles in the background.','The Nez Perce chose their camp site in the Big Hole in part due to the Camas, whose roots they gathered prior to the August 9th attack.','https://www.nps.gov/common/uploads/structured_data/9931E00B-1DD8-B71B-0BE1335A10F923B6.jpg',212);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Mountain Howitzer at the Big Hole Battlefield','a cannon overlooks a valley and distant mountains','Nez Perce warriors captured and dismantled the Mountain Howitzer cannon before the US army could use it effectively at the Battle of the Big Hole.','https://www.nps.gov/common/uploads/structured_data/99620D14-1DD8-B71B-0B4DFE31C3E61867.jpg',213);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Monument to the US Soldiers and Volunteers at the Big Hole Battlefield','cross country skis rest against a large granite monument on a snowy day.','In 1883 the United States Government erected this monument in honor of the soldiers and volunteers that served and died at the 1877 Battle of the Big Hole.','https://www.nps.gov/common/uploads/structured_data/998698BD-1DD8-B71B-0BDE2583FD29ECDC.jpg',214);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Chief Joseph Memorial at the Big Hole Battlefield','Stone carving of a Nez Perce Warrior\'s head in full regalia.','This monument, erected on the Big Hole Battlefield in 1928, reads; \"To the everlasting memory of the brave warriors Chief Joseph\'s Band who fought on these grounds in the Nez Perce War of 1877.\"','https://www.nps.gov/common/uploads/structured_data/999116F8-1DD8-B71B-0B3F5A6151D017CE.jpg',215);
