INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS photo','Aerial View of Capulin Volcano','View of cinder cone volcano and the road leading to the top of the volcano as seen from the air.','Capulin Volcano is a classic example of a cinder cone. The crater is approximately 130 m (420 ft) deep and 440 m (1,450 ft) across. The base of the mountain is 6 km (4 mi) in circumference. Volcano Road spirals up the volcano, providing panoramic views.','https://www.nps.gov/common/uploads/structured_data/3C84FDF7-1DD8-B71B-0B21AAE5CD8316CB.jpg',428);
