INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo/A. Buccanero','Volcano Road','Layers of rock are visible in the steep hillside along a road.','Layers of volcanic material can be seen in the Volcano Road that takes visitors to the top of Capulin Volcano.','https://www.nps.gov/common/uploads/structured_data/3C85008E-1DD8-B71B-0B2FEF52E96A172C.jpg',430);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('USGS','Capulin Volcano-Best Example of a Cinder Cone in North America','View of a cinder cone volcano covered with grasses, small trees, and other plants.','Although Capulin Mountain is considered no longer active, because its excellent condition, the cinder cone is considered one of the best and most accessible examples of a cinder cone in North America.','https://www.nps.gov/common/uploads/structured_data/3C8501F7-1DD8-B71B-0B83ABCF518E1D2B.jpg',431);
