INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Chaco Culture NHP 006/001-image02a','Red Mesa Black on White Bowls','Black on White Bowls','Many of the things discovered at Chaco came from other places. These bowls came from the Red Mesa area. Red Mesa Black on White was produced from about A.D. 875 to 1040. Due to the lack of adequate resources, very few pots were produced in Chaco Canyon.','https://www.nps.gov/common/uploads/structured_data/3C82F405-1DD8-B71B-0B2EB1FEC35F52B9.jpg',483);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Chaco Culture NHP 0006_001_image07','Pueblo Bonito with Cliff Face','Pueblo Bonito with Cliff Face','Pueblo Bonito is the most famous Chacoan great house. Constructed between 850 and 1150, Pueblo Bonito had almost 700 rooms, 32 kivas, and 3 great kivas.','https://www.nps.gov/common/uploads/structured_data/3C82F638-1DD8-B71B-0B93D85F83991274.jpg',484);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Chaco Culture NHP pitchers_chcu36353','Gallup Black on White Pitchers','Gallup Black on White Pitchers','These pitchers are another form of pottery that was created elsewhere and then brought to Chaco canyon. This particular style was manufactured from A.D. 1030 to 1150.','https://www.nps.gov/common/uploads/structured_data/3C82F9F6-1DD8-B71B-0BFA9886BFAD2CC7.jpg',485);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('James Smith','Night Sky Above Fajada Butte','Night Sky Above Fajada Butte','In 2013 Chaco Culture NHP was designated an International Dark Sky Park. The park has night sky and sunrise programs throughout the year.','https://www.nps.gov/common/uploads/structured_data/3C82FF90-1DD8-B71B-0B13101755CBAD75.jpg',486);
