INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Tim Hauf, timhaufphotography.com','Inspiration Point by Tim Hauf','Steep, rugged ocean cliffs extending in an island chain.','Inspiration Point, Anacapa Island: One of the most spectacular views in the park can be found from Inspiration Point. Looking to the west, one may see Middle and West Anacapa, with Santa Cruz Island in the distance.','https://www.nps.gov/common/uploads/structured_data/8DE774D1-CB22-37F2-D826E3F0A73D303A.jpg',493);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Tim Hauf, timhaufphotography.com','Arch Point by Tim Hauf','Yellow flowers in foreground extending out along a rocky coastline to a natural arch.','Arch Point, Santa Barbara Island: With winter rains, the coreopsis emerges from summer\'s dormancy with light green foliage and bright yellow daisy-like flowers','https://www.nps.gov/common/uploads/structured_data/8E0CA65D-0CF8-87C6-DE4B4AA7AAC02DEA.jpg',494);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Tim Hauf, timhaufphotography.com','Torrey Pines by Tim Hauf','Pine tree high on a ridge overlooking a bay with blue water and white sand beach.','Torrey Pines, Santa Rosa Island: Torrey pines occur naturally in only two locations throughout the world--on the cool, fog drenched northeastern slopes of Bechers Bay and just north of San Diego.','https://www.nps.gov/common/uploads/structured_data/8DF30150-D91A-D761-4A5064BA77154E2C.jpg',495);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Tim Hauf, timhaufphotography.com','Point Bennet by Tim Hauf','Brown seals and sea lions on white sand beach with blue water and partly cloudy sky.','Point Bennet, San Miguel Island: One of the greatest concentrations of wildlife in the world occurs on San Miguel with over 100,000 pinnipeds gathering to breed, pup, and rest.','https://www.nps.gov/common/uploads/structured_data/8E1AE30B-DBDB-C193-C1023F2C7591ABA0.jpg',496);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Tim Hauf, timhaufphotography.com','Island Fox by Tim Hauf','Rust and grey colored fox in green grass.','Island Fox, Santa Cruz Island: Thousands of years of isolation in a unique island environment has resulted in the development of the endemic island fox, a dwarf form of the mainland gray fox.','https://www.nps.gov/common/uploads/structured_data/8E003516-C693-8617-61EC2F2E06BA1E45.jpg',497);
