INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Nick Caito','Coltsville Dome and the Church of the Good Shepherd','The Blue Onion Dome of the Armory and the spire of the Church against a cloudy blue sky.','The Blue Onion Dome was rebuilt after the fire in February of 1864. Today it graces the skyline of Hartford, just as the the Church of the Good Shepherd does, reminding those who see if of the Colts and their legacy.','https://www.nps.gov/common/uploads/structured_data/EB096218-ED23-E8AF-49E048261B1677DF.jpg',585);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Nick Caito','The Church of the Good Shepherd','A church and trees against the backdrop of a bight blue sky and clouds.','The Church of the Good Shepherd was built by Elizabeth Colt as memorial to her husband, Samuel Colt, and their three children who passed in infancy. It was designed by Edward Tuckerman Potter and dedicate in 1869.','https://www.nps.gov/common/uploads/structured_data/EB2CF528-E321-D96B-CD91D782D29281DE.jpg',586);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Nick Caito','Armsmear','A tan and brown building, built in the Italian Villa style with rounded arches and balconies.','Armsmear was the family home of Samuel and Elizabeth Colt built between 1856 and 1857. It would remain the family home, until the death of Elizabeth in 1905. Today it is a non-profit organization that provides housing for senior women of limited means.','https://www.nps.gov/common/uploads/structured_data/EAE88851-BE73-F97E-6FF7828FA3B27823.jpg',587);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The Caldwell Memorial Parish House','A tan and brown building with numerous design elements meant resemble a ship, against a blue sky.','The Caldwell Memorial Parish House was built in memory of Caldwell Colt, Elizabeth and Samuel\'s son. It was designed by Edward Tuckerman Potter and dedicated in 1896.','https://www.nps.gov/common/uploads/structured_data/EB5CB0A0-C288-F7F4-51A32A9B0F833A31.jpeg',588);
