INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Nick Caito','Samuel Colt Statue','A memorial statue of a young and adult Samuel Colt','The statute was built as a memorial to Samuel by his wife, Elizabeth Colt. It was dedicated in 1906 after her passing in 1905.','https://www.nps.gov/common/uploads/structured_data/EC838CC3-A3A8-8741-8BB4EF01634AFC88.jpg',590);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Samuel Colt Statue','A statue of a young and an adult Samuel Colt in front of a tree with a cloudy sky.','The statue was built as a memorial to Samuel Colt by his wife, Elizabeth Colt. It was dedicated in 1906 after her passing in 1905. The statue serves as a reminder the role the Colts had in the development of the City of Hartford.','https://www.nps.gov/common/uploads/structured_data/21C00959-C6CD-FA80-FA566997E106B193.jpg',591);
