INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Gap Cave','Cleopatra\'s Pool in the Gap Cave','Cleopatra\'s Pool is located deep in the Gap Cave','https://www.nps.gov/common/uploads/structured_data/3C87B8D9-1DD8-B71B-0B67040F789E2506.jpg',629);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Vegetated Dunes','Sand dunes covered with shrubs and grasses','Vegetation holds dunes in place providing a barrier to erosion forces and creating essential interdune meadows to support island life.','https://www.nps.gov/common/uploads/structured_data/3C803FAD-1DD8-B71B-0BF8968CDECF2468.jpg',630);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Home To Wildlife','Alligator resting on a log in pond','Cumberland Island National Seashore encompasses a variety of forest, marsh, and coastal landscapes providing a home for numerous species including American Alligators.','https://www.nps.gov/common/uploads/structured_data/3C804128-1DD8-B71B-0B7FDC20E9D9373F.jpg',631);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Undeveloped Coast','Ocean beach at sunrise','Cumberland Island National Seashore encompasses nearly 18 miles of undeveloped beach offering recreation for visitors and essential nesting area for birds and sea turtles.','https://www.nps.gov/common/uploads/structured_data/3C804293-1DD8-B71B-0B3C50A212C19199.jpg',632);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Plum Orchard Mansion','large, white mansion behind oak trees draped with Spanish Moss','Visitors can take a guided tour of the Plum Orchard Mansion and experience the luxuries of Victorian high society as well as the effort and ingenuity it took to make it possible.','https://www.nps.gov/common/uploads/structured_data/3C804721-1DD8-B71B-0B674DD331D1FC2B.jpg',633);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Island Bluffs Shaped By Tides','rippled sands of a beach in front of pine tree covered bluffs','Tidal forces continue to shape the land today as they have for thousands of years forming high bluffs used for fortifications and ship docking throughout the island’s history.','https://www.nps.gov/common/uploads/structured_data/3C805318-1DD8-B71B-0BEE73A8A7441F08.jpg',634);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Historic Main Road','huge oak trees and palm shrubs line a sand road','While visitors to the island cannot bring vehicles, they can travel the historic main park road by foot and bicycle. Some remaining island residents will still drive vehicles on the road to reach their residences as they have for generations.','https://www.nps.gov/common/uploads/structured_data/3C805E82-1DD8-B71B-0B894349D0BBFF6B.jpg',635);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Dungeness Ruins','brick and stone ruins of a large mansion at sunset under colorful clouds','Dugeness was the largest mansion built on the island as part of the Carnegie Estate. Though lost to fire in 1959, the ruins of the mansion and several of its support structures are a reminder of the island’s rich history.','https://www.nps.gov/common/uploads/structured_data/3C806429-1DD8-B71B-0B9351B8366AB7C2.jpg',636);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The Settlement','small white one room church, old red house in the background, under cloudy skies','The remote north end of the island is home to the First African Baptist Church and The Settlement, where African American residents were able to purchase their first deeded property on the island at the end of the 1800s.','https://www.nps.gov/common/uploads/structured_data/3C8065C5-1DD8-B71B-0B3CC16BCC695D70.jpg',637);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Tidal Creek','tidal creek at low tide surrounded by palm and oak trees','Rising tides bring valuable nutrients into tidal creeks, while receding tides remove waste. This makes the tide cycle the beating heart of the island’s tidal creeks, salt marshes, and estuaries.','https://www.nps.gov/common/uploads/structured_data/3C806748-1DD8-B71B-0B9947D4C0E897DE.jpg',638);
