INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Dan Johnson','Mitten Park from Harpers Corner','view of a river flowing through a deep canyon','Hikers arriving at the end of the Harpers Corner Trail are rewarded with a view of the Mitten Park Fault, Green River and the Yampa River Canyons','https://www.nps.gov/common/uploads/structured_data/3C83DE76-1DD8-B71B-0B00DA4DE320CD4B.jpg',708);
