INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Brett Seymour','Night sky at the Dry Tortugas','A few of the stars at night with a view of Fort Jefferson.','The Dry Tortugas is so remote that night sky viewing is possible.','https://www.nps.gov/common/uploads/structured_data/3C81050F-1DD8-B71B-0B45EDC68B621860.jpg',712);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Maria Belen Farias','Sunset at Fort Jefferson','Park visitors enjoy a sunset on the moat wall.','Sunsets at the Dry Tortugas are breathtaking. Visitors who choose to camp over night can view the sun set at Fort Jefferson.','https://www.nps.gov/common/uploads/structured_data/3C80FF02-1DD8-B71B-0B39AC51BF7B2FA2.jpg',713);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Maria Belen Farias','Inside Fort Jefferson','A view inside Fort Jefferson.','Garden Key is the second largest island in the Dry Tortugas, about 14 acres in size, and has had the most human impact. Located on Garden Key is historic Fort Jefferson, one of the nation’s largest 19th century forts and a central cultural feature of Dry','https://www.nps.gov/common/uploads/structured_data/3C8103D0-1DD8-B71B-0B6DB5CF9A4AC58F.jpg',714);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Diving at the Dry Tortugas','Two divers dive the Windjammer Wreck','The Dry Tortugas has over 300 sunken ships. One of the most accessible is the Winjammer Wreck which can be dove or snorkeled.','https://www.nps.gov/common/uploads/structured_data/3C810626-1DD8-B71B-0B1DFF7BCF9A0682.jpg',715);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Maria Belen Farias','Loggerhead Key','A boat passes in front of Loggerhead Key during sunset.','The largest island in the Dry Tortugas, Loggerhead Key is a site of shipwrecks, a significant lighthouse installation, and where the historic Carnegie Laboratory for Marine Ecology once stood. Named for its abundance of loggerhead sea turtles, Loggerhead','https://www.nps.gov/common/uploads/structured_data/3C810258-1DD8-B71B-0BE07AC43C736990.jpg',716);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Maria Belen Farias','Fort Jefferson','A view of Fort Jefferson from the moat all.','ort Jefferson is a massive but unfinished coastal fortress. It is the largest masonry structure in the Americas, and is composed of over 16 million bricks.','https://www.nps.gov/common/uploads/structured_data/3C810049-1DD8-B71B-0B0040641619D4A6.jpg',717);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Aerial view of the Dry Tortugas','An aerial view of the Dry Tortugas','The Dry Tortugas is made up of seven islands.','https://www.nps.gov/common/uploads/structured_data/3C810722-1DD8-B71B-0BAD4B445F0C3D8C.jpg',718);
