INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / H. Richards','Mt Baker and the historic Smith Barn','Mt Baker and the historic Smith Barn','The views from the prairie overlook tell a story of farming and community that stretches back for centuries.','https://www.nps.gov/common/uploads/structured_data/3C84BF6A-1DD8-B71B-0B478117375417E0.jpg',727);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / H. Richards','Sunrise Over a Prairie Farm','Sunrise over the prairie.','Ebey\'s Landing National Historical Reserve exists to preserve a working rural farm community.','https://www.nps.gov/common/uploads/structured_data/3C84C127-1DD8-B71B-0B41F30944B7EABF.jpg',728);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / H. Richards','Historic Ferry House','Historic Ferry House','The Ferry House sits in the heart of the Reserve, a testament to the community that calls this place home.','https://www.nps.gov/common/uploads/structured_data/3C84C278-1DD8-B71B-0B90C49906FF109C.jpg',729);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Poe House, exterior','Color photo of a rectangular three story brick home with rows of windows on each floor.','Edgar Allan Poe lived in Philadelphia for six years, but he resided at this home for about a year, 1843-1844.','https://www.nps.gov/common/uploads/structured_data/3C7AD5D5-1DD8-B71B-0BAF630A8D440C44.jpg',730);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Parlor','Color photo of the parlor in the Poe House showing illustrations of furniture on the walls.','Wall mounted illustrations show how the room may have been furnished when Edgar Allan Poe lived in the house.','https://www.nps.gov/common/uploads/structured_data/3C7AD771-1DD8-B71B-0BF92D5BF1AA42AD.jpg',731);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Basement','Color photo of the basement with brick floor, false chimney, and wooden staircase.','Is this where Poe got his inspiration for \"The Black Cat?\"  Descend to the basement and decide for yourself.','https://www.nps.gov/common/uploads/structured_data/3C7AD91A-1DD8-B71B-0BE6FA39AD8699F5.jpg',732);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Raven statue','Color photo showing a large raven statue with wings outspread on a metal plinth.','Stand in the shadow of the raven statue in the yard.','https://www.nps.gov/common/uploads/structured_data/3C7ADB03-1DD8-B71B-0B9758787DC596DC.jpg',733);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The Reading Room','A small red-carpeted room with faux marble table, red upholstered chairs and sofa, and red curtains.','The Reading Room at the Edgar Allan Poe National Historical Site is furnished according to Poe\'s satirical essay \"The Philosophy of Furniture.\"','https://www.nps.gov/common/uploads/structured_data/3C7ADC91-1DD8-B71B-0BA4AAA889D0F489.jpg',734);
