INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Scenic Overlook at Fire Point','Scenic view of the steep bluffs adjacent to the Mississippi River as trees start to change color.','Scenic overlook from the popular Fire Point Trail overlooking the Mississippi River and Driftless area bluffs.','https://www.nps.gov/common/uploads/structured_data/3C7BB6EE-1DD8-B71B-0BDC4A0D83D76902.jpg',736);
