INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo/ Eaton Cote\'','Conical Mounds Leading to Fire Point','Circular mounds in a single line.','Follow a line of conical mounds that will lead you out to Fire Point which overlooks the Mississippi River.','https://www.nps.gov/common/uploads/structured_data/20611706-1DD8-B71B-0BEA4697A628DD12.jpg',738);
