INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Eisenhower home','The Eisenhower home with Ike\'s putting green in the foreground','President Eisenhower was an avid golfer and had a putting green added to the backyard.','https://www.nps.gov/common/uploads/structured_data/3C81389C-1DD8-B71B-0BDD6A8DAF590B3E.jpg',740);
