INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The Eisenhower living room','The Eisenhower living room','The Eisenhower living room.','https://www.nps.gov/common/uploads/structured_data/3C813D31-1DD8-B71B-0B034C188C3650B3.jpg',742);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The Eisenhower dining room decorated for the holidays','The Eisenhower dining room decorated for the holidays','The Eisenhower dining room decorated for the holidays.','https://www.nps.gov/common/uploads/structured_data/3C813E6E-1DD8-B71B-0B4D9B3A34C619BE.jpg',743);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Kuaua Ruin in Coronado Historic Site, Bernalillo, New Mexico','tan-colored pueblo Indian ruins with blue sky and three people','The Tiwa pueblo of Kuaua lies in ruin at Coronado Historic Site. The site includes a rebuilt kiva that displays reproductions of original murals adorning its walls. Be sure to go to the visitor center where some of the original murals are displayed.','https://www.nps.gov/common/uploads/structured_data/3C7A6685-1DD8-B71B-0B18BFB9BABA6FCD.jpg',744);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','El Rancho de las Golondrinas, La Cienega, New Mexico','adobe buildings including two beehive-looking ovens with people in a courtyard','El Rancho de las Golondrinas was a historic paraje (stopping place) along El Camino Real. “The ranch of the swallows” dates from the early 1700s, and is now being used as a living history museum.','https://www.nps.gov/common/uploads/structured_data/3C7A67D0-1DD8-B71B-0BA03160D7947352.jpg',745);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Jornada del Muerto, County Roads A013 & E070, Sierra & Doña Ana Counties, New Mexico','shrubby desert scene with people walking under a cloud-filled sky','Walk in the footsteps of settlers from the 1600s who had to walk along this dreaded yet unavoidable section of El Camino Real: Jornada del Muerto or Dead Man’s Journey.','https://www.nps.gov/common/uploads/structured_data/3C7A6943-1DD8-B71B-0B828BE24AE2C304.jpg',746);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Fort Selden Historic Site, Radium Springs, New Mexico','fort ruins in the sunlight with cottonwood trees on the left','Fort Selden was built near the town of Las Cruces in 1865 and housed troops for 25 years. The visitor center offers exhibits on frontier military life during the fort’s heyday and the grounds are self-guided.','https://www.nps.gov/common/uploads/structured_data/3C7A6A93-1DD8-B71B-0B25C2DE5079660E.jpg',747);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Presidio Chapel of San Elizario, Mission Trail, El Paso, Texas','large white chapel under blue sky','Spanish troops built a presidio (fort) and chapel at this site during the 1780s to protect settlements in the lower Río Grande Valley downstream from El Paso, Texas.','https://www.nps.gov/common/uploads/structured_data/3C7A6C65-1DD8-B71B-0B2FFD7FF839895F.jpg',748);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Christopher Talbot','Mission San Bernardo ruins, Guerrero, Coahuila, Mexico','Mexican mission stands in the dirt','Construction of the mission church began in 1760 but was never completed. The outstanding ruins are virtually the only visible remains of the complex of missions established in the area. The purpose was to convert Coahuiltecan Indians to Catholicism.','https://www.nps.gov/common/uploads/structured_data/3C7E7812-1DD8-B71B-0B21FD984B4C001C.jpg',749);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Christopher Talbot','El Paso de Jacinto/Paso de los Indios, Webb County, Texas','lots of greenery along a river; sunflowers in the foreground','Around 1746, explorer Jacinto de León discovered a ford that allowed safe passage across the Río Grande in this vicinity; it had probably been used for centuries by American Indians.','https://www.nps.gov/common/uploads/structured_data/3C7E7952-1DD8-B71B-0BFB5B12C3B0E5DA.jpg',750);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Christopher Talbot','Rancho los Ojuelos, Webb County, Texas','stone house ruins; briliant green grasses and trees on the right','This national historic district consists of 13 stone houses (several in ruins) constructed from hewn sandstone blocks, chinked and plastered, ranging from rectangular flat roofed Colonial style buildings to hip roofed two room structures. Post-1750s.','https://www.nps.gov/common/uploads/structured_data/3C7E7ABC-1DD8-B71B-0B412CEDBCA85B2A.jpg',751);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Christopher Talbot','McKinney Falls State Park, Travis County, Texas','rock indentations in a dry creek with five people walking under clouds','Recent research reveals that in 1716 the expedition of Domingo Ramón followed the left bank of Onion Creek along the western edge of McKinney Falls State Park to its junction with Williamson Creek. You can walk in rock indentations in the creek bed.','https://www.nps.gov/common/uploads/structured_data/3C7E7C07-1DD8-B71B-0B637A2BD1BCF7A6.jpg',752);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Christopher Talbot','Mission Tejas State Park, Houston County, Texas','trail segment indentation with leaves in it, trees along the side','This 1.5-mile-long trail segment crosses an area that has remarkable visual integrity. The trail segment courses parallel to State Road 21 and at times crosses the highway.','https://www.nps.gov/common/uploads/structured_data/3C7E7D2D-1DD8-B71B-0BBC1AD8F8F8B91C.jpg',753);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Kristi Rugg','Sandstone Bluffs Overlook','Yellow sandstone cliff at sunset with dark lava field in background','Sandstone Bluffs Overlook offers a beautiful view over the vast volcanic landscape of El Malpais.','https://www.nps.gov/common/uploads/structured_data/40AD6A6E-E9B1-E6D9-779C33D5A86F5316.jpg',754);
