INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Pool at El Morro','Pool at El Morro','A drinking hole for visitors for hundreds of years, the pool at El Morro has significant cultural and historical value.','https://www.nps.gov/common/uploads/structured_data/3C7E4EBE-1DD8-B71B-0BC4CD28327D4CA3.jpg',760);
