INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo/Bill Urbin','Stone Cottage at Val-Kill','Stone Cottage at Val-Kill','Val-Kill is a special place that serves as a window into Eleanor Roosevelt\'s private and public life.','https://www.nps.gov/common/uploads/structured_data/3C81147A-1DD8-B71B-0B93079165077EB8.jpg',765);
