INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo/Bill Urbin','View of Val-Kill Cottage from the garden','View of Val-Kill cottage from the garden','Mrs. Roosevelt\'s favorite room was the sleeping porch on the second floor overlooking the garden.','https://www.nps.gov/common/uploads/structured_data/3C811703-1DD8-B71B-0B74E21B70160A92.jpg',767);
