INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Ellis Island Museum of Immigration','Beaux-Arts brick and limestone building with large arched windows and cupola-topped towers.','Over 12 million immigrants were processed at Ellis Island during the peak years of 1892-1924, most through this building which opened in 1900.','https://www.nps.gov/common/uploads/structured_data/3C856FAB-1DD8-B71B-0B0DD7A0B6955955.jpg',769);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Ellis Island\'s Registry Room','Great Hall has terra cotta-colored tile floor, a balcony, large arched windows, and vaulted ceiling','The Registry Room, also known as the Great Hall, is where millions of immigrants were inspected. They were required to pass both a medical and legal inspection before being allowed to enter the United States.','https://www.nps.gov/common/uploads/structured_data/3C85712F-1DD8-B71B-0B34087F99512E73.jpg',770);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Ellis Island Museum of Immigration','Brick and limestone building with maroon canopy leading to entrance.','Visitors to the museum today arrive by ferry, just like immigrants did a century ago.','https://www.nps.gov/common/uploads/structured_data/3C8572BD-1DD8-B71B-0B81C6A8E9D0420C.jpg',771);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Replica Inspection Desk in the Registry Room','Honey oak colored tall desk on tiled floor in Great Hall with arched windows and vaulted ceiling.','Inspectors at Ellis Island would conduct the legal examination from behind desks like these a century ago.','https://www.nps.gov/common/uploads/structured_data/3C8573F0-1DD8-B71B-0B81984644CB246E.jpg',772);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Bird\'s Eye View of Ellis Island','Artificially-expanded largely rectangular island with straight seawalls and large buildings.','Ellis Island was expanded from just a couple acres to over 30 to make room for a large immigration processing station, that included a state of the art hospital complex.','https://www.nps.gov/common/uploads/structured_data/3C857565-1DD8-B71B-0B2A86EE555A1F4D.jpg',773);
