INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Steeple of the Gloira Dei Church','A color photo of the Gloria Dei Church steeple during a sunset in Philadelphia.','The church building at Gloria Dei \'Old Swedes\' has been in use since 1700, making it the oldest church building in Pennsylvania and the second oldest in the United States.  The steeple was completed in 1703.','https://www.nps.gov/common/uploads/structured_data/3C7FA643-1DD8-B71B-0BC25E1EB46EC74C.jpg',1079);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Gloria Dei Chuch yard','A color photo of the Gloria Dei Church yard showing tombstones with the church in the background.','Gloria Dei Church was designated as a National Historical Site in 1942. The Gloria Dei congregation owns and maintains the church and the related buildings, its ministry and the grounds.','https://www.nps.gov/common/uploads/structured_data/3C80CE82-1DD8-B71B-0BCB32C44FF22EAF.jpg',1080);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Interior of the Gloria Dei Church','A color photo of the interior of Gloria Dei Church showing the pulpit and a stained glass window.','Situated above the pulpit is the only stained glass window in the church building.  Created in the mid 1800s, the window is the earliest example of American stained glass among the 3600 windows in the Philadelphia region.','https://www.nps.gov/common/uploads/structured_data/3C80CFED-1DD8-B71B-0BBC536D1F7B75A5.jpg',1081);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Library of Congress Photo','Model of a ship hanging inside Gloria Dei Church','A color photo of a model tall ship hanging inside Gloria Die Church.','Hanging from the ceiling of Gloria Dei are models of the two ships that brought the first Swedish colonists to North America in 1638, the \"Kalmar Nyckel\" and the \"Fogel Gryp.\"','https://www.nps.gov/common/uploads/structured_data/3C81EA73-1DD8-B71B-0B2939FEE627A95A.jpg',1082);
