INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Blacksmith Shop & Cast House','Side view of blacksmith shop with cast house behind it.','The Cast House was the industrial center of the ironworks.  It is were iron ore was smelted into iron metal and products.  The smaller blacksmith shop formed iron metal into all kinds of necessary tools and goods used in everyday life.','https://www.nps.gov/common/uploads/structured_data/08475132-1DD8-B71B-0B2CA141C1F9566A.jpg',1311);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Hopewell Stove','Side view of Hopewell Stove in front of wagon running gear.','The most notable manufactured product Hopewell Furnace made was its stoves.  They were produced by the thousands at Hopewell and other like furnaces in the early 19th century and were transported for sale by horse and wagon.','https://www.nps.gov/common/uploads/structured_data/08ACB3DD-1DD8-B71B-0B3BBB847B459559.jpg',1312);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Charcoal Pile','Demonstration charcoal pile smoldering.','Charcoal was the fuel used to fire Hopewell Furnace and other furnaces of its age.  Thousands of bushles of charcoal were made from hardwood trees on the furnace lands and entered into the furnace to keep it \"in blast.\"','https://www.nps.gov/common/uploads/structured_data/09205130-1DD8-B71B-0B6D2D12C6918F4D.jpg',1313);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Vester Marable','Visitor Center','blue cannon sits in front of park\'s visitor center','The Horseshoe Bend NMP\'s Mission 66 Visitor Center with 1812 era 3-pounder cannon.','https://www.nps.gov/common/uploads/structured_data/3C87586A-1DD8-B71B-0BDE37630D876F7D.jpg',1314);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Alice Rush','Cannon on Gun Hill','A blue painted 6-pounder cannon sits on hill facing the battlefield','On Gun Hill, the historic cannon sits approximately where Gen. Andrew Jackson\'s artillery pieces fired upon the stout log barricade erected by Red Stick Creeks during the Battle of the Horseshoe.','https://www.nps.gov/common/uploads/structured_data/3C875FFD-1DD8-B71B-0BB4A52AD17D9A31.jpg',1315);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Alice Rush','Nature Trail','Sunlight shining through the tree canopy along the nature trail','Visitors can find solitude, seasonal beauty, and abundant wildlife along the 2.8 mile trail through the park.','https://www.nps.gov/common/uploads/structured_data/3C8764D7-1DD8-B71B-0B4730C9BBA009B5.jpg',1316);
