INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The Front Porch, Garfield Home','Front porch of Garfield home showing red front door','The front porch of James Garfield\'s home was the scene of the first front porch campaign. The presidential candidate gave patriotic speeches and met with thousands of people who came to which him well during the summer and fall of 1880.','https://www.nps.gov/common/uploads/structured_data/3C8438A8-1DD8-B71B-0B1FAF95F1FC35BF.jpg',1379);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Visitor Center','Visitor Center from the south','The Visitor Center occupies the original carriage house, built in 1894.','https://www.nps.gov/common/uploads/structured_data/3C8435E5-1DD8-B71B-0BFDFF07D291687D.jpg',1380);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Visitor Center, Main Entrance','Visitor Center main entrance off the parking lot.','A friendly greeting awaits visitors who enter the Visitor Center. This historic building, constructed in 1894, serves as bookstore, exhibit gallery and auditorium where the park film is shown. Tickets for tours of the Garfield home are also available her','https://www.nps.gov/common/uploads/structured_data/3C8439F9-1DD8-B71B-0B103789390E4E50.jpg',1381);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','James A. Garfield National Historic Site','a large gray house with a red roof','Thousands to visitors came to this front porch to hear presidential candidate James A. Garfield speak in 1880.','https://www.nps.gov/common/uploads/structured_data/A2F80175-01B6-E59B-6A850AC1EAD3586B.jpg',1382);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Library addition, north side','A view of the memorial library addition through the trees.','Mrs. Garfield constructed a beautiful addition to the Garfield home following the President\'s assassination in 1881. These 9 rooms contain the first Presidential Memorial Library,  including the a fireproof vault which once contained Garfield\'s papers.','https://www.nps.gov/common/uploads/structured_data/3C843733-1DD8-B71B-0B6D977CFFF656D0.jpg',1383);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Hand-painted Fireplace Tile, Garfield Dining Room','Hand-painted tile shows a bird next with blue eggs','Mrs. Garfield was known for her artistic talent, which softly blankets the interior of the Garfield home. In particular, the dining room boasts two tiles which were hand-painted by Mrs. Garfield, surround by others done by her children.','https://www.nps.gov/common/uploads/structured_data/3C843B7E-1DD8-B71B-0BA080B0BC3D4D98.jpg',1384);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Barataria Preserve of Jean Lafitte National Historical Park and Preserve','Spanish moss hangs from live oak tree','Spanish moss and lush vegetation provide glimpses of Louisiana\'s wild wetlands at Jean Lafitte\'s Barataria Preserve.','https://www.nps.gov/common/uploads/structured_data/3C845D16-1DD8-B71B-0B04181AABF4F0C1.jpg',1385);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Chalmete Battlefield at Jean Lafitte National Historical Park and Preserve','An oak tree arches over a cannon-guarded rampart with historic house and American flag in background','Chalmette Battlefield\'s American rampart and cannons still guard the site of the Battle of New Orleans in 1815.','https://www.nps.gov/common/uploads/structured_data/3C845E7E-1DD8-B71B-0BE1AC184B0AF650.jpg',1386);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Chalmette National Cemetery at Jean Lafitte National Historical Park and Preserve','Setting sun lights up cemetery headstones','Established during the Civil War, Chalmette National Cemetery\'s 14,000+ headstones pay tribute to those buried there.','https://www.nps.gov/common/uploads/structured_data/3C8461CD-1DD8-B71B-0BA0A3EAB3AFD319.jpg',1387);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','French Quarter Visitor Center of Jean Lafitte National Historical Park and Preserve','Visitor center exhibit titled \"Crossroads of Cultures\"','Hundreds of years of history and thousands of people from all over the world have created New Orleans\' distinctive cultural mix.','https://www.nps.gov/common/uploads/structured_data/3C846B2F-1DD8-B71B-0B8FA8F547ADCE23.jpg',1388);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Acadian Cultural Center of Jean Lafitte National Historical Park and Preserve','Model of an early Acadian home sits in a glass case','Bringing skills and traditions from Nova Scotia, the Acadian exiles in Louisiana found a new home and a new name---Cajuns.','https://www.nps.gov/common/uploads/structured_data/3C846C76-1DD8-B71B-0BCC7D9571EBF0FA.jpg',1389);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Wetlands Acadian Cultural Center of Jean Lafitte National Historical Park and Preserve','Exhibit case full of musical instruments','Acadian (Cajun) music began in cabins and dancehalls and has become famous worldwide.','https://www.nps.gov/common/uploads/structured_data/3C846EF3-1DD8-B71B-0B4D8391F7C91BC6.jpg',1390);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Prairie Acadian Cultural Center of Jean Lafitte National Historical Park and Preserve','guitar sits on a dimly lit porch styled stage','The Music Porch at the Prairie Acadian Cultural Center in Eunice, LA','https://www.nps.gov/common/uploads/structured_data/99468C42-EE93-353D-DC5C106FC356B7F8.jpg',1391);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Staff Photo','Target Room','The target room inside Jewel Cave.','The target room inside Jewel Cave.','https://www.nps.gov/common/uploads/structured_data/C6DE6447-A12D-692B-419DBA224FA0D35B.jpg',1392);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Dan Austin','Hourglass Lake','A cave explorer sits on some rocks and looks at a clear blue lake in Jewel Cave.','Volunteer cave explorers discovered Hourglass Lake in October 2015, the first sizable body of water found within Jewel Cave.','https://www.nps.gov/common/uploads/structured_data/3C7D11EA-1DD8-B71B-0BCC921BDE9A9253.jpg',1393);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Dan Austin','Inner Sanctum','A park ranger is standing on a metal platform within a long passageway with a vaulted ceiling.','The Inner Sanctum is one of the longest and largest passageways along the Scenic Tour route, located near the Torture Room.','https://www.nps.gov/common/uploads/structured_data/3C7D1365-1DD8-B71B-0BEF0C64C6FA265F.jpg',1394);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The Brain Drain','A caver squeezes through a very small and tight opening, surrounded by multi-colored rocks.','The Brain Drain is approximately eight inches high by 24 inches wide and is the tightest passage on the Wild Caving Tour.','https://www.nps.gov/common/uploads/structured_data/3C7D14CA-1DD8-B71B-0BFB17D039DD3B5F.jpg',1395);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Dan Austin','The Heavenly Room','A park ranger stands as a silhouette in a large room in Jewel Cave.','The Heavenly Room is a large room along the Historic Lantern Tour within the historic entrance of Jewel Cave.','https://www.nps.gov/common/uploads/structured_data/3C7D1629-1DD8-B71B-0BC7B364204E089C.jpg',1396);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Nailhead Spar','White-colored crystals with blunt tips sparkle against a black background.','Calcite crystals, such as nailhead spar, cover most of the walls, ceilings, and floors within Jewel Cave.','https://www.nps.gov/common/uploads/structured_data/3C7D1784-1DD8-B71B-0B48192F22E64243.jpg',1397);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Bradley Block','Rocky Mountain Bighorn Sheep','A bighorn sheep ram stands in the highway, with a camper stopped in the other lane.','Rocky mountain bighorn sheep are commonly seen within the monument, usually along Highway 16.','https://www.nps.gov/common/uploads/structured_data/64C79BE0-A659-8840-42FFC92F36170B12.jpg',1398);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / VIP Melissa Oehler','Red Squirrel','A small red squirrel stands on a dead pine branch.','Red squirrels are commonly observed along the Roof Trail near the visitor center.','https://www.nps.gov/common/uploads/structured_data/6631318F-9E50-F1B1-5C46DBD78B098DC0.jpg',1399);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Bradley Block','Fall Season Foliage in Fog','Fog filters through a stand of pine trees, with red and yellow foliage on the forest floor.','Autumn is a beautiful time of year to visit the monument. The colors of fall are often the best during mid to late September.','https://www.nps.gov/common/uploads/structured_data/666058D9-0055-1D9F-119532F940F10BB9.jpg',1400);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Bradley Block','Winter in the Pines','Snow covers the ground and flocks pine trees.','Although a \"slower\" time of year, the winter season offers some of the best scenery of the ponderosa pine forest.','https://www.nps.gov/common/uploads/structured_data/6683C845-E7F9-D3F7-FA56BC263BEE5F1E.jpg',1401);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / VIP Connie McKinney','Canyons Trail Descending toward the Historic Entrance','A paved path with steps heads down a hillside, with rock overhangs and pine trees nearby.','A portion of the Canyons Trail passes the historic entrance of Jewel Cave, with breathtaking views of nearby Hell Canyon.','https://www.nps.gov/common/uploads/structured_data/669C0495-B3C1-7748-53CD13838A8BFB70.jpg',1402);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Bradley Block','Theodore Roosevelt Addresses an Audience','A look-alike Theodore Roosevelt speaks to visitors on the patio of the visitor center.','The monument hosts special events each summer, such as living history presentations of President Theodore Roosevelt.','https://www.nps.gov/common/uploads/structured_data/66D0137A-EFCF-7E62-092A694DA721B7CD.jpg',1403);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Quentin Bucker','The Ranger Cabin at Jewel Cave','A small, dark-brown cabin sits on top of a hill with a walking path leading to its front porch.','The original park ranger cabin, built during the 1930s, is available for public access during the summer and early fall seasons.','https://www.nps.gov/common/uploads/structured_data/67005513-E175-D6A5-3F71D5C040E134FE.png',1404);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Bradley Block','Visitor Center Exhibit Area','A wall mural showing red-colored rock transitions into a room with a large cave map on the wall.','The visitor center provides several engaging exhibits and displays about the resources within the monument.','https://www.nps.gov/common/uploads/structured_data/67260458-B411-2D76-E0F699529DB0957E.jpg',1405);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Bradley Block','Pasque Flowers in Bloom','White to light purple flowers with yellow centers poke through pine needles.','Jewel Cave is home to several species of wildflowers, such as the South Dakota State Flower - the pasque flower.','https://www.nps.gov/common/uploads/structured_data/675DE44F-038D-5BF2-BF9048834962E325.jpg',1406);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / VIP Connie McKinney','Bats at Jewel Cave','A small brown bat rests on a red-orange colored rock.','Nine species of bats live within Jewel Cave National Monument. At times, visitors may see bats outside the historic entrance.','https://www.nps.gov/common/uploads/structured_data/6748AFF4-EBD6-9370-E358E0B05929CD5B.jpg',1407);
