INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Tylor Tanaka','Overview of Kalaupapa Peninsula','View of Kalaupapa Peninsula from Overlook','The Kalaupapa peninsula was once a prison for those inflicted with Hansen\'s disease.  Approximately 8000 people were forced to live their lives in isolation here.','https://www.nps.gov/common/uploads/structured_data/3C79B6CD-1DD8-B71B-0BB2B4265DD8C023.jpg',1454);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Tylor Tanaka','Pali (Sea cliffs) at Kalaupapa','View of pali (sea cliffs) on the north shore of Molokai','Kalaupapa National Historical Park contains some of the world\'s tallest sea cliffs, which formed a natural barrier to the Hansen\'s disease settlement.','https://www.nps.gov/common/uploads/structured_data/3C79B7CD-1DD8-B71B-0B8DB166CD47FFDB.jpg',1455);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / T. Scott Williams','Kalaupapa Settlement','View of residences along Damien Road','Patients lived in a combination of group homes and single family residences at Kalaupapa.','https://www.nps.gov/common/uploads/structured_data/3C79B8BD-1DD8-B71B-0B3642258A7FDC63.jpg',1456);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / T. Scott Williams','Kalawao at Sunrise','View of the sunrise over the north shore of Molokai','Kalawao with its rocky shoreline was the landing spot for the first Hansen\'s disease patients sent to Kalaupapa.','https://www.nps.gov/common/uploads/structured_data/3C79B9C9-1DD8-B71B-0B1470C968F06B2B.jpg',1457);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / T. Scott Williams','Black Sand Beach','View of Black Sand Beach and Awahua Bay','Black Sand Beach is one of several sandy beaches at Kalaupapa, most known for its sea turtle nesting habitat.','https://www.nps.gov/common/uploads/structured_data/3C79BAC7-1DD8-B71B-0B078B6EFFA7389B.jpg',1458);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Ricki Cooke','Archeological Sites at Kalaupapa','View of rock walls and native Hawaiian archeological sites at Kalaupapa.','Kalaupapa is also home to one of the most well-preserved archeological complexes in all of Hawaii.','https://www.nps.gov/common/uploads/structured_data/3C79BC2E-1DD8-B71B-0B49012B61D78A2D.jpg',1459);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / T. Scott Williams','Siloama Church at Kalawao','Siloama Church at Kalawao settlement','Siloama Church was the first church established at Kalawao in 1866.  It is one of two remaining buildings at Kalawao today.','https://www.nps.gov/common/uploads/structured_data/3C79BD53-1DD8-B71B-0BB4FD504DF437D9.jpg',1460);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS photo / Carrie Mardorf','St. Damien\'s Grave','View of St. Damien\'s Grave at Kalawao with ocean in background.','Saint Damien is one of two Catholic saints at Kalaupapa who came to serve the Hansen\'s disease patients in the late 19th century.','https://www.nps.gov/common/uploads/structured_data/3C79BE86-1DD8-B71B-0B01A4BC9D46895E.jpg',1461);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Carrie Mardorf','Paschoal Hall','View of Paschoal Hall also known as the Kalaupapa Social Hall','Paschoal Hall, also known as the Kalaupapa Social Hall, served as the community\'s recreational center with movies, entertainers, and dances.','https://www.nps.gov/common/uploads/structured_data/3C79C017-1DD8-B71B-0BD168E88DAC63D3.jpg',1462);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Carrie Mardorf','Papaloa Cemetery','View of grave markers at Papaloa Cemetery in Kalaupapa','Kalaupapa is the final resting place for approximately 8000 people. Papaloa Cemetery is the largest cemetery located along the west shoreline of the peninsula.','https://www.nps.gov/common/uploads/structured_data/3C79C154-1DD8-B71B-0BC5CA3DB22D958E.jpg',1463);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Carrie Mardorf','Kana\'ana Hou Church','View of Kana\'ana Hou Church through gates','Religion was a prominent part of patients\' lives at Kalaupapa. Protestant, Catholic, and Mormon churches were established at both Kalawao and Kalaupapa settlements.','https://www.nps.gov/common/uploads/structured_data/3C79C27D-1DD8-B71B-0B337F0D95572F83.jpg',1464);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Carrie Mardorf','Kalaupapa Pier','View of warehouse and store at the Kalaupapa Pier','The Kalaupapa Pier, warehouse, and store were the lifeline of the settlement during the 20th century. Historically, shipments of goods and supplies were sent to Kalaupapa weekly.','https://www.nps.gov/common/uploads/structured_data/3C79C3CC-1DD8-B71B-0B9C6E566A1432EE.jpg',1465);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Kaloko Fishpond','The rehabilitation of Kaloko fishpond started in 1998 and still continues today....','Kaloko Fishpond is the largest walled fishpond in the state (800 ft. long)','https://www.nps.gov/common/uploads/structured_data/3C821C0B-1DD8-B71B-0B75B0451911CCAA.jpg',1466);
