INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / James Kramer','Lake Clark','Photo of blue sky with fluffy white clouds reflect in calm lake with mountains in the background.','The park\'s namesake lake is the largest lake by volume in the National Park Service.','https://www.nps.gov/common/uploads/structured_data/3C7A9F9E-1DD8-B71B-0B6CEC8EF3F377DA.jpg',1537);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Karen Smigielski','Tanalian Falls','Waterfall surrounded by forest in fall foiliage and mountains in the background.','The park protects thousands of waterfalls including Tanalian Falls, which is a popular day hike destination from the town of Port Alsworth.','https://www.nps.gov/common/uploads/structured_data/3C7AA462-1DD8-B71B-0BB13D97381C04B0.jpg',1538);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Paige Spencer','Redoubt Volcano','Photo of a stratovolcano flanked with glaciers towering over a river valley.','Lake Clark is a land of fire and ice. Active volcanism and retreating glaciers created and continue to shape the peaks, moraines, and river systems in the Chigmit and Neacola Mountains.','https://www.nps.gov/common/uploads/structured_data/3C7AA140-1DD8-B71B-0BE3ECC0A8EE0DE5.jpg',1539);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Chuck Lindsay','Tanaina Glacier','photo of large alpine glacier','Perenial snow and glacial ice covers ~1,250 square miles, or 20% of Lake Clark National Park and Preserve.','https://www.nps.gov/common/uploads/structured_data/3C7A9D02-1DD8-B71B-0B154E93FCC5D7F9.jpg',1540);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Kara Lewandowski','Two cubs playing at Silver Salmon Creek','two brown bear cubs playing in the sedges','Bear viewing is a popular activity along the Cook Inlet Coast.','https://www.nps.gov/common/uploads/structured_data/C521C4DB-C6CB-EB6B-242225CB76BAB42E.jpg',1541);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo/ J.Mills','Boreal Forest','Forest of spruce trees blanketed in snow and fog.','Boreal forests encircle the earth\'s northern latitudes like an emerald necklace. Lake Clark\'s forest, which covers more than 440 thousand acres or 11% of the park,  is dominated by white spruce mixed with black spruce and birch.','https://www.nps.gov/common/uploads/structured_data/3C7A9BBB-1DD8-B71B-0BD4675D87449A15.jpg',1542);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / J.Mills','Telaquana Lake','A colorful sky, an island with spruce trees, and mountains in the background reflect in a calm lake','A number of glacier fed lakes pepper the western boundary of the Chigmit and Neacola mountains like a string of spectacular turquoise gems.','https://www.nps.gov/common/uploads/structured_data/3C7AA70A-1DD8-B71B-0BCA87C6E2CA136E.jpg',1543);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Alaska ShoreZone','West Glacier Creek','Photo of a river delta flowing into tidal flats surrounded by green salt marshes and mountains.','Estuaries where rivers meet the sea provide a mosaic of rich habitats along the Cook Inlet Coast that support high numbers of bears and other wildlife.','https://www.nps.gov/common/uploads/structured_data/3C7AA5B4-1DD8-B71B-0BCD819BADB29D2E.jpg',1544);
