INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Cross Estate Mansion and Gardens','The Cross Estate mansion in the springtime','The Cross Estate property was the site of the New Jersey Brigade winter encampement in 1779-1780. Today the encampment site is preserved while the estate is host to several beautiful gardens.','https://www.nps.gov/common/uploads/structured_data/3C804E96-1DD8-B71B-0B9824672DCF8A75.jpg',1801);
