INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS photo/T. Winslow','View from Fort Nonsense','Overlook with cannon in foreground','Fort Nonsense--the site of an earthen fort during the American Revolution-offers a view toward New York City','https://www.nps.gov/common/uploads/structured_data/682F75C9-EF72-E0B6-793A4834A192E3B4.jpg',1805);
