INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('JD Hascup Photo','Silver Forest Sunset','A purple and pink streaked sky over a mountain peak and forested valley.','The Silver Forest Trail at Sunrise features spectacular views of Mount Rainier and the White River valley.','https://www.nps.gov/common/uploads/structured_data/49F34094-B893-7DD6-5AE0F0220724B0EF.jpg',1807);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Climbing Mount Rainier','Climber on glacier steps downward with icy crags in background.','Summiting Mount Rainier involves climbing a volcano, scaling glaciers, dealing with high elevations and much more. Almost 10,000 people a year attempt to summit.','https://www.nps.gov/common/uploads/structured_data/3C7CEEF2-1DD8-B71B-0B9F3B666327E5D1.jpg',1808);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Emily Brouwer','Giants of the Old-Growth Forest','Towering cedars and douglas-firs reach skyward while a beam of sun breaks through the canopy.','With some of the few remaining old-growth forests in the Cascade Mountains, Mount Rainier National Park protects native plants great and small in places like the Grove of the Patriarchs.','https://www.nps.gov/common/uploads/structured_data/3C7C6C47-1DD8-B71B-0BFF9108D08A7FD3.jpg',1809);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Marmot in Morning Dew','A hoary marmot with white frosted fur rests on a rock beside white flowers in a meadow.','From small amphibians and hoary marmots to the black bears and elk, many animals call the wild places of Mount Rainier home.','https://www.nps.gov/common/uploads/structured_data/3C7C6D8C-1DD8-B71B-0BA69E7F583E25A5.jpg',1810);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Steve Redman','Kids Hiking Through Wildflower Meadow','Two children hike on trail through wildflower meadow with Mount Rainier above them.','Enjoying the outdoors through recreation is a big part of many visitors\' experiences.','https://www.nps.gov/common/uploads/structured_data/3C7CECB5-1DD8-B71B-0B54548D95910CF4.jpg',1811);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Emily Brouwer','Mount Rainier at sunset','Sunset paints the glaciers of Mount Rainier in pink and gold.','Every scenic overlook shows a different side of Mount Rainier. Viewed from Gobblers Knob Lookout at sunset, the glaciers covering the mountain turn pink and gold.','https://www.nps.gov/common/uploads/structured_data/3C7C68E6-1DD8-B71B-0B42E9A3C7ECA52D.jpg',1812);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','National Park Inn in Winter','The historic National Park Inn covered in a foot of snow.','For thousands of years, people have traveled up to, over, and around Mount Rainier. Today the park strives to preserve this history while providing a chance for new generations to find their own adventures.','https://www.nps.gov/common/uploads/structured_data/3C7C6EE9-1DD8-B71B-0B62C52C6844CC70.jpg',1813);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo/ K. Loving','Wildflower Meadow Along the Wonderland Trail','Purple lupine and white bistort bloom in a meadow alongside a sign for the Wonderland Trail.','Both the Wonderland Trail and subalpine meadows encircle Mount Rainier. Summertime blooms splatter the hillsides with color.','https://www.nps.gov/common/uploads/structured_data/3C7C6A93-1DD8-B71B-0BA75B16C5FA3690.jpeg',1814);
