INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Alice Kong','Bridge through Muir Woods','A wooden bridge crosses Redwood Creek in the redwood forest','Summer is a busy time at Muir Woods. Visit early in the morning for the most pleasant experience.','https://www.nps.gov/common/uploads/structured_data/3C7CA33A-1DD8-B71B-0B079C22EF081D8A.jpg',1823);
