INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Al Greening','Lady Fern','A Lady Fern grows over Redwood Creek','At least ten species of ferns grow in Muir Woods - fern seem to grow larger in redwood forests than other forests - possibly competing for attention from the redwoods?','https://www.nps.gov/common/uploads/structured_data/3C7CAC6C-1DD8-B71B-0B402BF4A347DB0A.jpg',1825);
