INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo/Kristen Henderson','Banana Slug','A yellow banana slug creeping along a twig','Banana slugs creep along the forest floor in Muir Woods and are likely to be abundant in the warmer days of winter.','https://www.nps.gov/common/uploads/structured_data/3C7CB0A8-1DD8-B71B-0BD784613755F996.jpg',1829);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Melrose Mansion','Two story brick mansion with columns','Melrose and its landscape present a comprehensive picture of the Southern planter class and the enslaved people who lived and worked there.','https://www.nps.gov/common/uploads/structured_data/BC2BF996-9A1D-637F-B279C39E2232C4C4.jpg',1830);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','William Johnson House','Two story brick townhouse','The William Johnson House provides a window into the life of a free man of color whose published diary and personal papers provide a detailed account of daily life in the antebellum south.','https://www.nps.gov/common/uploads/structured_data/3C81B15F-1DD8-B71B-0BB55AA9504C9A9A.jpg',1831);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Melrose Slave Cabin','One story wood frame house with two doors and two windows','One of two remaining slave cabins at the Melrose estate','https://www.nps.gov/common/uploads/structured_data/3C81B2EC-1DD8-B71B-0BC23CDD587DFBA5.jpg',1832);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Inside Melrose Slave Cabin','Room containing very simple wood table and chair, and baby cradle with fireplace in background','The furnished slave cabin at Melrose helps to illustrate  the daily life of the enslaved.','https://www.nps.gov/common/uploads/structured_data/3C81B4C3-1DD8-B71B-0BE3A29CF3697BBC.jpg',1833);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Inside the William Johnson House','room with tall windows and fireplace, round table containing lamp and surrounded by chairs','Visitors to the William Johnson House can see many original furnishings.','https://www.nps.gov/common/uploads/structured_data/3C81B61B-1DD8-B71B-0B02E907D6D77626.jpg',1834);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Potkopinu Section of the Natchez Trace National Scenic Trail','Potkopinu Section of the Natchez Trace National Scenic Trail','The Potkopinu section, between milepost 17 and 20, follows the historic Old Trace. The \"sunken\" nature of the trail is due to the footsteps of thousands of travelers between the 1780s and 1820s in the soft loess soil.','https://www.nps.gov/common/uploads/structured_data/3C843CE5-1DD8-B71B-0BAFBFE2E37ADA31.jpg',1835);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Rocky Springs Section of the Natchez Trace National Scenic Trail','A section of the Old Trace at Rocky Springs (MP 52.4-59)','A section of the Old Trace at Rocky Springs (MP 52.4-59)','https://www.nps.gov/common/uploads/structured_data/3C843EB9-1DD8-B71B-0B958F0F60585D20.jpg',1836);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Yockanookany Section Trail Head at Cypress Swamp','A fork in the trail with directional signs','Access to the Yockanookany section of the National Scenic Trail at Cypress Swamp (MP 122)','https://www.nps.gov/common/uploads/structured_data/3C844095-1DD8-B71B-0BC51A5324727B09.jpg',1837);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Natchez Trace Parkway in Early Fall','A slightly curvy section of the Natchez Trace Parkway in Early Fall','The Natchez Trace Parkway commemorates a historic travel route that helped build the young United States. The Parkway 444 miles, with plenty of stops to allow you to explore some of the history or enjoy the scenery along the way.','https://www.nps.gov/common/uploads/structured_data/3C80016C-1DD8-B71B-0B91B2FA75DF0C02.jpg',1838);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Double Arch Bridge over Birdsong Hollow (milepost 438) on the Natchez Trace Parkway','View of the Double Arch Bridge from Birdsong Hollow','The elegant Double Arch Bridge won the Presidential Award for Design Excellence in 1995. It spans Birdsong Hollow and Tennessee Highway 96. To see it from below, take the TN 96 exit and stop at the pulloff before you get to the highway.','https://www.nps.gov/common/uploads/structured_data/3C7FFB07-1DD8-B71B-0B35C15D0834A556.jpg',1839);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Mount Locust Historic House (milepost 15.5) on the Natchez Trace Parkway','Mount Locust Historic House','Mount Locust served as a family home and as a stand, or inn, for Natchez Trace travelers. Built around 1780, the home and grounds are open for visitors during operating hours.','https://www.nps.gov/common/uploads/structured_data/3C7FFE3F-1DD8-B71B-0B9E86CB3BBD9041.jpg',1840);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Old Trace (milepost 221.4) on the Natchez Trace Parkway','A foggy section of the Old Trace in autumn','The \"Old Trace,\" the historic trail commemorated by the Natchez Trace Parkway today, still survives in segments. The Old Trace was the main road through the Old Southwest, connecting Natchez to Nashville by going through Chickasaw and Choctaw lands.','https://www.nps.gov/common/uploads/structured_data/3C7FFFCC-1DD8-B71B-0B86D0A48B59ADCE.jpg',1841);
