INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS photo','Children \'s Area','Tiles with hand prints and chalkboards set into the ground for children.','This area provides letter shaped chalkboards to allow the continued emotional expressions from those young and old. A surrounding wall displays a collection of painted tiles sent by schools, showing their compassion for the bombing-affected community','https://www.nps.gov/common/uploads/structured_data/3C85F67B-1DD8-B71B-0B799239B62FEB48.jpg',1944);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS photo','Memorial Fence','Fencing with pictures, stuffed animals and other tokens left on it.','This 200 foot section of chain link fence was taken from the original barrier surrounding the bombing site. The fence served as the first spontaneous memorial and a location for people to leave tokens of collective grief. It retains this purpose still to','https://www.nps.gov/common/uploads/structured_data/3C85F79B-1DD8-B71B-0BD14779809F811D.jpg',1945);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS photo','Summer Nights','Summer evening photo of the Memorial lit up at night','Beat the summer heat, on an evening stroll through the illuminated Field of Empty Chairs, the Gates of Time, and the Survivor Tree. All walkways are brightened to allow enjoyment of this peaceful time of day.','https://www.nps.gov/common/uploads/structured_data/3C85F8B3-1DD8-B71B-0B42BD5B47E91976.jpg',1946);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS photo','Snow on Empty Chairs','Snow covered Field of Empty Chairs','The Memorial becomes a silent place during the rare winter snow storms that blow through. The cold and quiet house a stillness made for reflection as one walks through the Field of Empty Chairs.','https://www.nps.gov/common/uploads/structured_data/3C85F9BE-1DD8-B71B-0B3ABFFE82E626E3.jpg',1947);
