INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo/ Bolyard','Flowering Fishhook Pincushion Cactus','A flowering fishhook pincushion cactus','Wildflower season at Saguaro National Park is at it\'s peak in the month of MArch.The Pincushion cactus,however,blooms April through August.','https://www.nps.gov/common/uploads/structured_data/3C858462-1DD8-B71B-0BB499810C61332C.jpg',2295);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Coyote Pups','Two coyote pups captured on a wilderness camera','Saguaro National Park has a vast variety of wildlife,and with the help of wilderness cameras,can be photographed to help with studies and for visitors to learn about animals only seen by chance.','https://www.nps.gov/common/uploads/structured_data/3C858613-1DD8-B71B-0BEFB533FAB3FB55.jpg',2296);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Saguaro National Park Lighting Storm','Lightning strike captured on camera with saguaros in the background','Saguaro deaths are usually attributed to natural weather conditions and other natural phenomena.Specifically,lightning strikes have been known to strike saguaros due to the large amount of water stored within their fleshy tissue.','https://www.nps.gov/common/uploads/structured_data/3C85873C-1DD8-B71B-0BA5D81599611142.jpg',2297);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Weather at Saguaro National Park','Rare Sight of snow in Saguaro National Park East Visitor Center (Rincon Mountain District)','Saguaro National Park summers can be extremely hot with temperatures exceeding 105 degrees F,lows averaging 72 degrees F.Winters are mild warm days averaging 65 degrees F and cool nights averaging 40 degrees F.Snowfall is extremely rare in the area.','https://www.nps.gov/common/uploads/structured_data/3C858903-1DD8-B71B-0BE2312B40DB3D26.jpg',2298);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Group of Regal Horned Lizards','A group of Phrynosoma solare,or regal horned lizards.','Regal horned lizards are one of many reptiles in the park,who have adapted to living in the harsh desert environment.Information on how different species survive can be found on the park \'s website, visitor center, or through our many programs offered.','https://www.nps.gov/common/uploads/structured_data/3C858AB6-1DD8-B71B-0B0F6C0A56410894.jpg',2299);
