INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Springfield Armory National Historic Site','The Main Arsenal','The Main Arsenal at Springfield Armory National Historic Site was first built in 1850 and today houses the park\'s amazing collection of historic firearms.','https://www.nps.gov/common/uploads/structured_data/D351A3D5-1DD8-B71B-0B9E169EA16305E9.jpg',2427);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Blank Firing Demostration','Three Park Volunteers, holding historic firearms, on the grounds of the Armory against a cloudy sky.','Park Volunteers give a blank firing demonstration of historic firearms.','https://www.nps.gov/common/uploads/structured_data/EE59D277-BB59-B95A-FE0BCA4D6B22DC70.jpg',2428);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Springfield Armory Clock Tower','The tower of the Armory with the flag at full mast blowing in the wind on a cloudy day.','Following the closure of the Springfield Armory in 1968, public action would drive Congress to create Springfield Armory National Historic Site in the late 1970s.','https://www.nps.gov/common/uploads/structured_data/EE8C00C2-BDE4-9CC3-2686707A304148B6.jpg',2429);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Organ of Muskets','A double musket rack holding 645 Springfield US Model 1861 rifle muskets.','Named after a poem by Henry Wadsworth Longfellow, the Organ of Muskets consists of 647 Model 1861 Rifle Muskets. This structure would have held 1100 muskets when fully stocked and would have been one of many that filled the Arsenal during the Civil War.','https://www.nps.gov/common/uploads/structured_data/EF74A0C2-E271-6041-2D2A097B9A5D86A4.jpg',2430);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Springfield Main Arsenal on a Fall Day','The Springfield Armory Main Arsenal on a fall day, with blue skies and the flag at half staff.','Springfield Armory began the production of small arms in 1794 and continued until its close in 1968. In 1978, the Armory reopened under the direction of the National Park Service as a National Historic Site.','https://www.nps.gov/common/uploads/structured_data/EF9A4AF9-EFC3-BF6E-7224498221C4EB81.jpg',2431);
