INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Alan Schulze','Pennsylvania Box Car and Lackawanna Caboose','Black and yellow diesel engine 514 pulling a faded red box car and a dark red caboose','Nickel Plate Road No. 514 can often be seen moving cars around in the rail yard at Steamtown National Historic Site.  Here, it can be seen pulling a Box Car and Caboose.','https://www.nps.gov/common/uploads/structured_data/8C4271D7-DA2A-91D0-352FDDC192DB531B.jpg',2448);
