INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo / Buddy Secor','Sunrise at Mendenhall\'s Artillery Trail','The sun rises behind a green field with a cannon in the foreground.','On January 2, 1863, fifty-seven Union cannons fired from this line ending the Battle of Stones River by killing or wounding more than 1,800 Confederates in less than an hour.','https://www.nps.gov/common/uploads/structured_data/7433C5A9-1DD8-B71B-0B8D22CB43F53B7C.jpg',2454);
