INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Chieftain\'s Museum, Rome, Georgia','large white house, green lawn, two trees in front','The museum tells the story of Major Ridge, the influential Ridge family including prominent son John Ridge, Cherokee history, and the Trail of Tears, as well as subsequent history of the home and region.','https://www.nps.gov/common/uploads/structured_data/3C7E670B-1DD8-B71B-0B25C5CD76BF4A04.jpg',2537);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Brown\'s Ferry Tavern, Chattanooga, Tennessee','structure in the background with large chimney on the end; signs saying Brown\'s Ferry Tavern','Cherokee leader John Brown, who owned 640 acres in this area, ordered the construction of Browns Ferry Tavern in 1803. In 1838, the road running past this structure was the route by which several Cherokee detachments were removed to present-day Oklahoma.','https://www.nps.gov/common/uploads/structured_data/3C7E6990-1DD8-B71B-0B75FFAF17A4B2A8.jpg',2538);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Mantle Rock Preserve, Joy, Kentucky','sunlight coming through trees with green leaves','Thousands of Cherokee camped for weeks along the main (northern) route, near Mantle Rock, during the winter of 1838-39 as they waited for ice conditions in the Ohio River to allow a safe crossing.','https://www.nps.gov/common/uploads/structured_data/3C7E6AE0-1DD8-B71B-0BD3C7623B4A0272.jpg',2539);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Cherokee Retracement at Pea Ridge National Military Park, Garfield, Arkansas','dozens of people walk a section of the Trail of Tears, winter scene, trees with no leaves','The Pea Ridge National Military Park encompasses 4,300 acres and features a visitor center, museum, self-guided tours, reconstructed Elkhorn Tavern, and a retracement trail along a 2.5-mile original route segment of the Trail of Tears.','https://www.nps.gov/common/uploads/structured_data/3C7E6C3A-1DD8-B71B-0B1C7619213A627A.jpg',2540);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Grave Stone of William Adair, Stilwell, Oklahoma','gravestone with words etched, green grass','When the Cherokee arrived at their prescribed disbandment depot in Oklahoma, settlements sprang up nearby. There was a depot at the Adair\'s farm near present-day Stilwell, Oklahoma.','https://www.nps.gov/common/uploads/structured_data/3C7E6EDB-1DD8-B71B-0BE8B4E27DEA21BB.jpg',2541);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS','Crabb Abbott Farm, Grantsburg, Illinois','Two people walk a remnant of the Trail of Tears. Spring setting with green leafed trees.','Crabb Abbott Farm has segments of the Northern Route, including the rock crossing and ford of Sugar Creek. These segments are contiguous with trail segments on the adjacent Shawnee National Forest.','https://www.nps.gov/common/uploads/structured_data/3C7E6D6E-1DD8-B71B-0BF2FB679C481F1A.jpg',2542);
