INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','La Fiesta de Tumacácori','folklorico dancers in front of church','The Fiesta de Tumacácori, held annually in December, has over 40 years of history and hundreds of years of heritage.','https://www.nps.gov/common/uploads/structured_data/3C79DADF-1DD8-B71B-0BBD3BEB58C2CF6C.jpg',2551);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Visiting Tumacácori','long paved sidewalk leads to adobe mission church','Modern facilities like paved sidewalks and restrooms complement a visit to this site\'s rich history.','https://www.nps.gov/common/uploads/structured_data/3C79DC55-1DD8-B71B-0BE9F6EF17F455BA.jpg',2552);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Visitors on a Mission Tour','ranger and visitors looking at church facade','Guided mission tours explore the hidden treasures and untold stories of Tumacácori\'s past.','https://www.nps.gov/common/uploads/structured_data/3C7E03BB-1DD8-B71B-0B741814262D08D0.jpg',2553);
