INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Tupelo National Battlefield Monument','The monument with a cannon','In July, 1864, Union forces, including men from the United States Colored Troops, marched into Tupelo, Mississippi.  Disorganized Confederate soldiers fought fiercely but could not overpower the federal troops.  Neither side could claim a clear victory,','https://www.nps.gov/common/uploads/structured_data/3C844354-1DD8-B71B-0B1A7DB85F697FC5.jpg',2555);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The \"Duchess Arlene\" -  flown by Robert Williams, Pilot class','Red-Tail P-51D Mustang In Flight Exhibit','One of the most beloved and recognized airplanes of World War II -  North American P-51D Mustang','https://www.nps.gov/common/uploads/structured_data/3C87CA3F-1DD8-B71B-0B1A6DBC5E5DF262.jpg',2556);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','Training Days at Tuskegee','A World War II flight simulator and PT-17 bi-wing training plane','Take a  \"Walk Back In Time\" in Hangar #1 to see the faces and visit the places where cadets trained as America\'s first African-American military pilots and support crews.','https://www.nps.gov/common/uploads/structured_data/3C87D300-1DD8-B71B-0BA370BA5F1C6609.jpg',2557);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('Air Force Historical Research Agency','And There Were Women...','Female Mechanic works on military aircraft','Many are amazed to learn of the vital role women played as part of the Tuskee \"Airmen\" Experience.','https://www.nps.gov/common/uploads/structured_data/3C87D884-1DD8-B71B-0B24DC2C235825AA.jpg',2558);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','First Flight - Eleanor Roosevelt was the first First Lady to fly with a Negro Pilot.','Small Yellow training plane used in the Civilian Pilot Training Prograj - J3 Piper Cub','Visitors are surprised to see the small size of the airplane in which First Lady Eleanor Roosevelt took a flight with Negro Pilot Charles A. Anderson.','https://www.nps.gov/common/uploads/structured_data/3C87E45C-1DD8-B71B-0B08D9001F7902E2.jpg',2559);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','History Lives at Moton Field','Two airplane hangars - Hangar #1 in foreground and Hangar #2 in background at Moton Field.','Come, experience the \"power of place\" where the Tuskegee Airmen blazed a trail that led to the civil rights movement.of the 1950\'s and 1960\'s.','https://www.nps.gov/common/uploads/structured_data/3C87E890-1DD8-B71B-0BB7C4487A4AF442.jpg',2560);
INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The Oaks - The Home of Booker T. Washington','A three story Queen Anne Revival style red brick house','This house, like Washington himself, was a lesson plan to both students and benefactors of Tuskegee Institute.','https://www.nps.gov/common/uploads/structured_data/3C880363-1DD8-B71B-0B19DE390A6D20CD.jpg',2561);
