INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo','The Movable School','A  brown colored modified school bus with two windows','Many are amazed to see the last Movable School that was used by Dr. George W. Carver to bring education to the rural communities surrounding Tuskegee','https://www.nps.gov/common/uploads/structured_data/7A401382-9926-84C4-24CF567718FB66F1.jpg',2563);
