INSERT INTO park_image(credit,title,altText,caption,url,uid) VALUES ('NPS Photo/ Neal Herbert','Icy Bay with Mt. St. Elias','Glaciers loom over the ocean with large snowy mountains rising into blue skies','Wrangell-St. Elias National Park contains a diversity of natural features.  Landscapes unique to the North American continent are common here.','https://www.nps.gov/common/uploads/structured_data/3C7AAD63-1DD8-B71B-0BCE10FFD741A687.jpg',2728);
